import React from 'react';
import { Link } from 'react-router-dom';

function HomePage({ onLogout }) {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100 px-4">
      <div className="bg-white rounded-2xl shadow-lg p-10 text-center w-full max-w-md relative">
        
        {/* Botón Cerrar Sesión */}
        <div className="absolute top-4 right-4">
          <button
            onClick={onLogout}
            className="bg-red-500 hover:bg-red-600 text-white text-sm px-3 py-2 rounded-lg shadow transition duration-200"
          >
            Cerrar Sesión
          </button>
        </div>

        {/* Título */}
        <h1 className="text-2xl font-semibold text-gray-800 mb-8">
          Seleccione una opción
        </h1>

        {/* Botones de navegación */}
        <div className="flex flex-col gap-4">
          {/* Botón Físico */}
          <Link to="/indexx">
            <button className="w-full bg-blue-600 hover:bg-blue-700 text-white py-3 rounded-xl font-medium transition duration-200">
              Físico
            </button>
          </Link>

          {/* Botón Historial */}
          <Link to="/dashboard">
            <button className="w-full bg-gray-700 hover:bg-gray-800 text-white py-3 rounded-xl font-medium transition duration-200">
              Historial
            </button>
          </Link>

          {/* Botón Horario */}
          <Link to="/control-horarios">
            <button className="w-full bg-green-600 hover:bg-green-700 text-white py-3 rounded-xl font-medium transition duration-200">
              Horario
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
